import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'networkidle' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Click on the "Your Profile" link to navigate to the profile page
    // Using getByRole to find the link by its accessible name
    await page.getByRole('link', { name: 'Your Profile' }).first().click();

    // Wait for the profile section to be visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Harvest user profile information
    const fullName = await page.locator('.profile-info h2').innerText();
    const username = await page.locator('.profile-info .username').innerText();
    const bio = await page.locator('.profile-info .bio').innerText();

    const extractedData = {
      fullName,
      username,
      bio
    };

    return {
      success: true,
      action: "Successfully harvested user profile information.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
